import React from 'react';
import { Link } from 'react-router-dom';

// import img1 from '../../images/daily/hiyoko_perfect.png';
// import img2 from '../../images/daily/hiyoko_good.png';
// import img3 from '../../images/daily/hiyoko_soso.png';
// import img4 from '../../images/daily/hiyoko_bad.png';


export const MoodContent = (mood) => {
  let eva;
  if(mood.mood === 'perfect'){
    eva = img1;
  }else if(mood.mood === 'good'){
    eva = img2;
  }else if(mood.mood === 'soso'){
    va = img3;
  }else{
    eva = img4;
  }

  return(
    <div>
      <Link to={`mood/${mood.id}`}> <h1>{mood.date}</h1> </Link>
        <img src={eva}/>
    </div>
  )
}
